import React from 'react';
import './labelInput.scss';

function LabelInput({classNameAdded = '', placeHolder =''}) {
    return (
        <>
            <label className={`${classNameAdded} labelInput`}>
                <input className="labelInput__input" autoComplete="name" placeholder={placeHolder} />
                <span className="labelInput__placeholder labelInput__placeholder--pink">{placeHolder}</span>
            </label>
        </>
    );
}

export default LabelInput;
